var unirest = require("unirest");
var Student = require('../model');

var count = 0;

var Run = function(faculty_code, priority) {
var req = unirest("POST", "http://tracuu.cntp.edu.vn/thongkenv.aspx");

req.headers({
  "accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8",
  "origin": "http//tracuu.cntp.edu.vn",
  "user-agent": "Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Ubuntu Chromium/43.0.2357.130 Chrome/43.0.2357.130 Safari/537.36",
  "cookie": "ASP.NET_SessionId=pbcavqceeb0bvmgokhwmorzr",
  "content-type": "application/x-www-form-urlencoded"
});

req.form({
  "ddlNV": priority,
  "ddlNganh": faculty_code,
  "btnTimKiem": "Tìm Kiếm",
  "__EVENTTARGET": "",
  "__EVENTARGUMENT": "",
  "__LASTFOCUS": "",
  "__EVENTVALIDATION": "",
  "__VIEWSTATE": "",
  "__VIEWSTATEGENERATOR": "9B5D5E1D"
});

  req.end(function (res) {
	//   console.log(res)
    if (res.error) {
      throw new Error(res.error);
    }
    
    var env = require('jsdom').env;
    var html = res.body;
  
    // first argument can be html string, filename, or url
    env(html, function (errors, window) {
        //console.log(errors);
        
        var $ = require('jquery')(window);
        var ufmTableData = $('table tr');
       	//console.log("tr ==> ", ufmTableData.text())
        
        if (ufmTableData.length) {
            var trs = $(ufmTableData)//.children("tr");
           
            $.each(trs, function(n, tr) {
                  var tds = $(tr).children("td");
                  var student = {
                      student_name: '',
                      student_id: '',
                      school_code: "DCT", // Ma~ truo`ng
                      faculty: faculty_code,
                      faculty_code: faculty_code, // Nga`nh 
                      subject_group: "",
                      priority: priority, // So thu tu nguyen vong uu tien
                      score_1 : 0,
                      score_2 : 0,
                      score_3 : 0,
                      score_priority: 0,
                      score_sum : 0
                  };
                  
                  $.each(tds, function(n, td) {
						if (n == 1) student.student_id = $(td).text().trim();
						if (n == 2) student.student_name = $(td).text().trim();
						if (n == 3) student.score_priority += getScorePriority2(parseInt($(td).text()));
						if (n == 4) student.score_priority += getScorePriority($(td).text().trim());
						if (n == 7) student.score_sum = parseFloat($(td).text().trim());
						if (n == 5) student.faculty = student.faculty_code = $(td).text().trim();
						if (n == 6) student.subject_group = getSubjectGroup($(td).text().trim());
                  });
                  
                  //console.log(student);
                  if (student.score_sum > 0) {
                    var saver = new Student(student);
          					saver.save(function (err, data) {
                      if (err) console.log("Error", err.message) 
          					  else console.log('Saved ['+ count++ +'] ', data.student_id);
          					});  
                  }
            });
        }
    });
  });
};

var getSubjectGroup = function(id) {
	var subjectGroups = [
		{ "key": "A00", "subject": "Toán-Lý-Hoá" },
		{ "key": "A", "subject": "Toán-Lý-Hoá" },
		{ "key": "A01", "subject": "Toán-Lý-Anh" },
		{ "key": "A1", "subject": "Toán-Lý-Anh" },
		{ "key": "B00", "subject": "Toán-Hóa-Sinh" },
		{ "key": "B", "subject": "Toán-Hóa-Sinh" },
		{ "key": "D01", "subject": "Toán-Văn-Anh" },
		{ "key": "D1", "subject": "Toán-Văn-Anh" },
		{ "key": "D", "subject": "Toán-Văn-Anh" },
		{ "key": "D02", "subject": "Văn-Toán-Nga" },
		{ "key": "D03", "subject": "Văn-Toán-Pháp" },
		{ "key": "D04", "subject": "Văn-Toán-Trung" },
		{ "key": "D06", "subject": "Văn-Toán-Nhật" },
		{ "key": "D07", "subject": "Toán-Hóa-Anh" },
		{ "key": "D08", "subject": "Toán-Sinh-Anh" },
		{ "key": "C00", "subject": "Văn-Sử-Địa" },
		{ "key": "C", "subject": "Văn-Sử-Địa" },
		{ "key": "C01", "subject": "Văn-Toán-Lý" },
		{ "key": "V01", "subject": "Toán-Văn-Vẽ" },
		{ "key": "N00", "subject": "Văn-NK-NK" },
		{ "key": "M00", "subject": "Văn-Toán-NK" },
	];
	
	for (var i in subjectGroups) {
		if (subjectGroups[i].key == id) return subjectGroups[i].subject;
	}
	
	return "";
};

var getScorePriority = function(religion) {
	var scores = [
		{ code: "1", score: 1.5}, 
		{ code: "2NT", score: 1.0},
		{ code: "2", score: 0.5},
		{ code: "3", score: 0.0},
		
	];
	
	for (var i in scores) {
		if (religion == scores[i].code) return scores[i].score;
	}
	
	return 0.0;
}

var getScorePriority2 = function(n) {
	if (n >= 1 && n <= 4) return 2.0;
	if (n >= 5 && n <= 7) return 1.0;
	return 0.0;
}

